import APIUtil from '../utils/APIUtils'

export default class FormModel {

    static list() {
        return new Promise((resolve, reject) => {
            APIUtil.postJSONWithCredentials(process.env.REACT_APP_DOMAIN + `/api/form/me`, JSON.stringify(form), resolve, reject);
        });
    }


}
